measurements.description:
Eight flowers and eight buds on three up to 36-cm upright inflorescences;
 sepals lanceolate, slightly undulate edges, light yellow, broadly barred
 light chestnut brown;
 petals broadly lanceolate, slightly undulate edges, yellow,
 proximal two-thirds rich chestnut brown;
 lip orbicular, pinched proximally, cream, overlaid light chestnut brown
 barring proximal half, margins blotched light chestnut brown,
 callus golden yellow, lightly barred chestnut brown; 
 column yellow, anther cap white;
 substance firm;
 texture glossy, lip satin.
